export const TodoList=({todoList,setTodoList})=>{
    return(
        <>
        <ol>
            {todoList.map(({content},index)=>{
                return(
                    <div
                    key={`${content}+${index}`}>
                    content={content}
                    </div>
                )
            })}
        </ol>
        </>
    )
}
